import React, { Component } from 'react'
import { connect } from 'react-redux'
import { NavLink } from 'react-router-dom'

class Nav extends Component {
 render() { 
  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
  		<div class="container-fluid">
    		<ul class="navbar-nav me-auto mb-2 mb-lg-0">
        		<li class="nav-item"> 
    				<NavLink to='/home' exact activeClassName='active' class="nav-link"> Home </NavLink>
       			</li>
    			<li class="nav-item"> 
    				<NavLink to='/leaderBoard' class="nav-link"> LeaderBoard </NavLink> 
    			</li>
     			<li class="nav-item">
        			<NavLink to='/newQuestion' class="nav-link"> New Question </NavLink>
    			</li>
    			<li class="nav-item">
        			<label class="nav-link"> Hello </label>
    			</li>
    			<li class="nav-item">
        			<NavLink to='/' class="nav-link"> Log Out </NavLink>
    			</li>
    		</ul>
    	</div>
    </nav>
  )
 }
}

function mapStateToProps({users,authedUser}) {

  let userArray = []

  Object.keys(users).forEach(function(key) {
    let obj = { "id": users[key].id, "name": users[key].name }; 
   	userArray.push(obj);
	});

   return {
     users: userArray
   }
}

export default connect(mapStateToProps)(Nav)
